import React, { useState } from 'react';

const WaitlistForm = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form data submitted:', formData);
    // Add form submission logic here (e.g., send data to an API)
  };

  return (
    <form className="w-full max-w-lg" onSubmit={handleSubmit}>
      <div className="flex flex-wrap mb-4">
        <div className="w-1/2 pr-2">
          <input
            type="text"
            name="firstName"
            value={formData.firstName}
            onChange={handleChange}
            placeholder="First name"
            className="p-3 mb-3 border border-gray-300 rounded-lg w-full"
            required
          />
        </div>
        <div className="w-1/2 pl-2">
          <input
            type="text"
            name="lastName"
            value={formData.lastName}
            onChange={handleChange}
            placeholder="Last name"
            className="p-3 mb-3 border border-gray-300 rounded-lg w-full"
            required
          />
        </div>
      </div>
      <div className="flex flex-wrap mb-4">
        <div className="w-2/3 pr-2">
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            placeholder="Email address"
            className="p-3 mb-3 border border-gray-300 rounded-lg w-full"
            required
          />
        </div>
        <div className="w-1/3 pl-2">
          <button type="submit" className="p-3 bg-black text-white rounded-lg w-full">Join waitlist</button>
        </div>
      </div>
    </form>
  );
};

export default WaitlistForm;
